import classes from "./Website.module.css";
import { Route, Switch, useHistory } from "react-router-dom";
import Header from "./Header";
import Footer from "./Footer";
import IntroductionBlock from "./Home/IntroductionBlock";
import CenterColumnLeftRightGrid from "./Home/CenterColumnLeftRightGrid";
import Testimonial from "./Home/Testimonial";
import Pricing from "./Home/Pricing";
import FAQ from "./Home/FAQ";
import TeamBlock from "./Home/TeamBlock";
import Appointment from "./Home/Apointment";
import BlogAndNewsBlock from "./Home/BlogAndNewsBlock";
import LeftImageRightText from "./Home/LeftImageRightText";

const Website = () => {
  const registerHandler = () => {
    window.open("createaccount", "_blank");
  };

  const loginHandler = () => {
    window.open("app/dashboard/general/exams", "_blank");
  };

  //   <div className={classes.actionButtons}>

  //        <button className={classes.registerButton} onClick={registerHandler}>  <b>Create an account</b> </button>
  //        <button className={classes.loginButton} onClick={loginHandler}> <b>Login </b> </button>

  //    </div>

  // <Switch>
  //             <Route exact path='/testresponse' >
  //               <div> Test will be taken here </div>
  //             </Route>
  //  </Switch>

  return (
    <div className={classes.website}>
      <div className={classes.innerDiv}>
        <Header />
        <IntroductionBlock />
        <CenterColumnLeftRightGrid />
        <LeftImageRightText />
        <Testimonial />
        <Pricing />
        <FAQ />
        <TeamBlock />
        <Appointment />
        <BlogAndNewsBlock />
        <Footer />
      </div>
    </div>
  );
};

export default Website;
